import React from "react";
import "../Stylesheets/Projects.css";
import { projects } from "../constants";
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineDot,
  TimelineOppositeContent,
} from "@mui/lab";
import { Button } from "@mui/material";
import Header from "./Header";

export default function Projects({ projectsRef }) {
  return (
    <>
      <div className="projects flex flex-col gap-4" ref={projectsRef}>
        <Header headerName="Featured Projects" />
        <div className="timeline mx-auto w-[60%]">
          <Timeline position="alternate">
            {projects.map((project, index) => {
              return (
                <TimelineItem key={index} className="mb-2">
                  <TimelineOppositeContent>
                    <div className="project-container flex flex-col rounded-[14px] p-6 content-center bg-white gap-3 text-left">
                      <img
                        className="rounded-lg"
                        src={project.img}
                        alt={project.alt}
                      />
                      <span className="project-title font-bold">
                        {project.name}
                      </span>
                      <span className="project-description text-sm">
                        {project.description}
                      </span>
                      <p className="project-tech text-xs flex flex-row content-between">
                        {project.stack}
                      </p>
                      <Button className="project-link">View More</Button>
                    </div>
                  </TimelineOppositeContent>
                  <TimelineSeparator>
                    <TimelineDot />
                    <TimelineConnector />
                  </TimelineSeparator>
                  <TimelineContent>{project.date}</TimelineContent>
                </TimelineItem>
              );
            })}
          </Timeline>
        </div>
      </div>
    </>
  );
}
